import React from "react";
import Navbar from "./components/Navbar";
import Stories from "./components/Stories";
import Post from "./components/Post";

const App = () => {
  return (
    <div className="max-w-md mx-auto">
      <Navbar />
      <Stories />
      <Post />
      <Post />
    </div>
  );
};

export default App;
